import { Link } from "react-router-dom";
import Rating from "./Rating";

export default function Accessory(props) {
  const { productAccessory } = props;
  return (
    <div>
      <div key={productAccessory._id} class="card-item">
        <Link to={`/accessory/${productAccessory._id}`}>
          <img
            src={productAccessory.image}
            width="450px"
            height="500px"
            alt={productAccessory.name}
          />
        </Link>
        <div>
          <a href={`/accessory/${productAccessory._id}`}>
            <h2 className="text">{productAccessory.name}</h2>
          </a>
        </div>
        <Rating
          rating={productAccessory.rating}
          numReviews={productAccessory.numReviews}
        ></Rating>
